import React, { Component } from 'react';

class FormBtn extends Component {
  render() {
    return (
      <form>
        <label>
          <input type="button" value="Enviar" />
          <button type="submit"></button>
        </label>
        <label>
          <input type="reset" value="Limpar" />
        </label>
      </form>
    )
  }
}

export default FormBtn;
